import axios from 'axios';

export default function Home() {
  return <DataFetching />

}

function Headline() {
  const greeting = 'Home Function Component!';
  return <h1>{greeting}</h1>;
}

function DataFetching() {
  const[city, setCity] = useState([])

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/citychoice/')
        .then(res => {
          console.log(res)
          setCity(res.data)
        })
        .catch(err => {
          console.log(err)
    })
  }, [])

  function handleChange(event) {
    updateSelectedData(event.target.value);
    if (props.onSelectChange) props.onSelectChange(selectedData);
  }
  let options = city.map(city => (
    <option key={city.id} value={city.id}>
      {city.city}
    </option>
  ));

  return (
      <div>
        <ul>
          {
            city.map(city => <li key={city.id}>{city.city} {city.city_value}</li>)
          }
        </ul>
       <select
      name="customSearch"
      className="custom-search-select"
      onChange={handleChange}>
      <option>Select Item</option>
      {options}
        </select>
      </div>
  )
}
